// Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from './AuthContext';

const Navbar = () => {
  const { token } = useAuth(); //get the token from the authentication context
  return (
    <div>
      <nav>
        <div>
          <Link to="/">Home</Link>
        </div>
        {!token ? (
          <div>
          <Link to="/login">Login</Link>
          </div>
        ) : null}
      </nav>
    </div>
  );
};

export default Navbar;
